    "2016-04-06T23:21:01.521190",nt"name": "early-retiree-reinsurance-program-reports",nt"isopen":
    true,nt"url": null,nt"notes": "<p>The Early Retiree Reinsurance Program
    (ERRP) was established by section 1102 of the Patient Protection and Affordable
    Care Act (the Affordable Care Act) enacted on March 23, 2010. Congress appropriated
    5 billion dollars for this temporary program and directed the Secretary of Health
    and Human Services (HHS) to set up the program within 90 days of enactment. Accordingly,
    HHS published an Interim Final Rule to implement the ERRP on May 5 with an effective
    date of June 1, 2010, and the program began accepting applications on June 29, 2010.
    The ERRP is scheduled to end no later than January 1, 2014 and will serve as a bridge
    to the new health insurance marketplace to be established through State-based Health
    Insurance Exchanges in 2014.</p>n",nt"license_title": "Other License Specified",nt"extras":
